import React from 'react';
import Card from './Card';
import portfolio from "../portfolio.json";

class Projects extends Component {

    state = {
        portfolio
    };

    render() {
        return (
            <Wrapper>
                {this.state.portfolio.map(project => (
                    <Projects
                        id={project.id}
                        key={project.id}
                        name={project.name}
                        image={project.image}
                        description={project.description}
                    />
                ))}
            </Wrapper>
        );
    }
}

export default Projects;
